import { StyleSheet, useWindowDimensions } from "react-native-web";

export default function useStyles() {
  const { width, height } = useWindowDimensions();
  return StyleSheet.create({
    container: {
      flexDirection: "row",
    },
    image: {
      width: 90,
      height: 90,
      borderRadius: 100,
    },
    round: {
      padding: 5,
      borderRadius: 100,
      marginRight: 10,
      borderWidth: 1,
      borderColor: '#0000FF',
    },
    nonePhoto: {
      height: 90,
      width: 90,
      backgroundColor: "#D9D9D9",
      justifyContent: "center",
      alignItems: "center",
    },
    info: {
      marginTop: 10,
      flexDirection: "column",
    },
    nickname: {
      fontSize: 20,
      fontWeight: "bold",
      marginBottom: 5,
      marginTop: 4
    },
    dateOfBirth: {
      fontSize: 14,
      color: "#999999",
    },
  });
}
